import { ListGroup, ListGroupItem, } from 'reactstrap';
import "slick-carousel/slick/slick.css";
import "slick-carousel/slick/slick-theme.css";
import AOS from 'aos';
import 'aos/dist/aos.css';







class TestimonialsSec  extends Component {


    render(){
        return(
            <div className="testimonials_sec" style={{background:`url('/images/testimonials_bg_patten.svg')`,}}>
                
                <div className="container testimonials_wrapper" style={{background:`url('/images/testimonial_wrapper_bg.svg')`,}}>
                    <h3 className="blog_title text-uppercase font-weight-bold text-center pb-3" data-aos="fade-up">i-BHARAT test </h3>
                   
                 </div>
            </div>

            
        );

        
    }

}
export default  TestimonialsSec;
